import React, { Component } from "react";
import { countries } from "./countries.json";

class Form extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
      email: "",
      date: ""
    };
  }
  handleChange = event => {
    this.setState({ [event.target.name]: event.target.value });
  };

  handleYear = () => {
    let output = [];
    for (let i = 2019; i >= 1900; i--) {
      output.push(
        <option key={i} value="{i}">
          {i}
        </option>
      );
    }
    return output;
  };

  handleMonth = () => {
    let output = [];
    for (let i = 1; i <= 12; i++) {
      output.push(
        <option key={i} value="{i}">
          {i}
        </option>
      );
    }
    return output;
  };

  handleDay = () => {
    let output = [];
    for (let i = 1; i <= 31; i++) {
      output.push(
        <option key={i} value="{i}">
          {i}
        </option>
      );
    }
    return output;
  };

  handleCountry = () => {
    let output = [];
    for (let i = 0; i < countries.length; i++) {
      output.push(
        <option key={i} value={countries[i].name}>
          {countries[i].name}
        </option>
      );
    }
    return output;
  };

  formCompleted = () => {};

  render() {
    return (
      <>
        <h1> Mars Mission Regristration Form </h1>
        <form onChange={this.handleChange}>
          <label htmlFor="name"> Name </label>
          <input
            type="text"
            placeholder="Your Name"
            name="name"
            value={this.state.name}
            id="name"
          />
          <br />
          <label htmlFor="email"> Email </label>
          <input
            type="text"
            placeholder="Your Email"
            name="email"
            value={this.state.email}
            id="email"
          />
          <br />
          <select htmlFor="date_of_birth">
            <option>Month</option>
            {this.handleMonth()}
          </select>
          <select htmlFor="date_of_birth">
            <option>Day</option>
            {this.handleDay()}
          </select>
          <select htmlFor="date_of_birth">
            <option>Year</option>
            {this.handleYear()}
          </select>
          <br />
          <p>What is your country of origin?</p>
          <select name="Country" value={this.state.countries}>
            <option>Country</option>
            {this.handleCountry()}
          </select>
          <br />
          <p>What is your dietary preference? </p>
          <select name="Diet">
            <option>Diet</option>
            <option>Omnivore</option>
            <option>Vegitarian</option>
            <option>Vegan</option>
          </select>
          <p>Why do you want to be a Mars explorer?</p>
          <textarea className="text" />
          <div className="ques">
            <div>
              <p>Can you breathe underwater longer than 1 minute?</p>
              Yes
              <input type="radio" value="Yes" name="question1" />
              <br />
              No
              <input type="radio" value="No" name="question1" />
              <br />
              I dont know
              <input type="radio" value="I dont Know" name="question1" />
            </div>
            <div>
              <p>What is your marital status?</p>
              Married
              <input type="radio" value="married" name="question2" />
            </div>
          </div>
        </form>
        <button type="submit">Submit</button>
      </>
    );
  }
}

export default Form;
